BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "expanded_pokemon_test" (
	"Number"	INTEGER NOT NULL,
	"Name"	TEXT NOT NULL,
	"Form"	TEXT,
	"Type1"	TEXT NOT NULL,
	"Type2 "	TEXT,
	"HP"	INTEGER NOT NULL,
	"Attack"	INTEGER NOT NULL,
	"Defense"	INTEGER NOT NULL,
	"SP.Attack"	INTEGER NOT NULL,
	"SP.Defense"	INTEGER NOT NULL,
	"Speed"	INTEGER NOT NULL,
	PRIMARY KEY("Number","Form","Name")
);
COMMIT;
